import React, { Component } from 'react';

import BaseLayout from '../components/layouts/BaseLayout';

class About extends Component {
  render() {
    return (
      <BaseLayout>
        <h1>About Page from a class component</h1>
      </BaseLayout>
    );
  }
}

export default About;
